import { Button } from "govuk-react";
import { CurrentContext } from "../../Pages/Temp";

import jq from "jquery";

function MyBtn(props) {
  function getData() {
    let patientData = {
      Postcode: CurrentContext.postcode,
    };

    jq.ajax({
      type: "POST",
      url: "http://localhost:4000/getpatientdata.php",
      mode: "no-core",
      data: patientData,
      success(data) {
        console.log(data);
        if (data === "no patients") {
          props.callBack('');
        } else {
          var json = jq.parseJSON(data);
          props.callBack(json[0].NHSNumber);
        }
      },
    });
  }

  return <Button onClick={getData}> Submit </Button>;
}
export default MyBtn;
